import { Component } from '@angular/core';

@Component({
  selector: 'app-create-room',
  templateUrl: './create-room.component.html',
  styleUrls: ['./create-room.component.css']
})
export class CreateRoomComponent {

}
<div class="container">
    <img src="../../assets/images/bg.jpeg" alt="background image" style="width:100%;">
    <div class="centered">
        <div class="circle-container" >
            <img src="" alt="Photo"> {{ userName}}
            <p class = "user">{{ user }}</p>
        </div>
            <input type = "text" placeholder="-Room Name-" class = "room" [ngModel] = "createRoom">
            <input type = "text" placeholder="-No of players-" class = "player" [ngModel] = "createRoom">
            <button (click)="next()" [disabled] = "!createRoom" >Next</button>

    </div>   
</div>
